window.bookSummaryJSON = "<p><b>We were warned about the threats we would face, and now our lives are in danger. </b></p> <p>The danger is more powerful than we'd ever imagined, and now that the flames have died off, we're off to a new destination with uncertainty around every corner. </p> <p>Time is running out for me, and I hope we aren't being taken on a wild goose—or chicken—chase to find the next creature. </p> <p>A creature from the sky will catch me when I fall, but what if I've already fallen?</p> <p><b><i>Creature of the Sky</i></b><b> is book two in the Her Creatures series and is a paranormal shifter romance told in multiple POVs. The main character will have multiple love interests and end up with them all. It contains mature scenes, adult language, and a cliff-hanger.</b></p>"; 
